  consultDatos(form?: NgForm){
    this.clienteService.ConsultarClienteExistente(form.value.numIden)
      .subscribe((res:any) => {
        console.log(res)
        if(res.state === 'true'){
          this.valorConsulta = ''
            const dataRecivida:any =
            {
              message:res.message,
              data:{
                nombres:res.data[0].nombres,
                id:res.data[0].id_cliente,
                tipo:res.data[0].id_tipo_cliente
              }
            }
            this.idCliente = res.data[0].id_cliente
            this.modalClienteExistente(dataRecivida)
              this.clienteService.obtenerValor(dataRecivida.data.tipo)
              .subscribe((resValor:any) =>{
                console.log(resValor)
                if(res.data[0].valor === 1){
                  this.estadoInstalacion = 'platform'
                  this.obtenerDiasXtipo = resValor[0].dias
                }else{
                  this.estadoInstalacion = 'noplatform'
                  this.obtenerDiasXtipo = resValor[0].dias
                }
              },(err:any) =>{
                return this.error('error',err.error)
              })
        }else{
          if(form.value.tipIden == undefined || form.value.tipIden == null || form.value.tipIden.length <= 0){
            return this.error('error','Tipo de Documento sin seleccionar')
          }
          if(form.value.tipIden == '1'){
            if($("#param").val() == "" || $("#param").val() == undefined || $("#param").val().length <= 0){
              return this.error('error','Ingresar Nro. Documento')
            }
            //validaciones
            this.clienteService.obtenerDatosXdni($("#param").val())
            .subscribe((res:any) => {
              const data:any = res
              if(data.apellido_paterno === undefined && data.apellido_materno === undefined) return alert('El D.N.I no existe. Por favor vuelva a verificar')
              this.clientesSeleccion.name = data.nombres
              this.clientesSeleccion.fl_name = data.apellido_paterno + ' ' + data.apellido_materno
              this.clientesSeleccion.direction = '';
              this.valorConsulta = 'uno'
              this.firstFormGroup.get('name').setValue(this.clientesSeleccion.name)
              this.firstFormGroup.get('fl_name').setValue(this.clientesSeleccion.fl_name)
            },err=>{
              console.log(err)
              this.error('error','Error al consultar D.N.I')
            });
          }else if(form.value.tipIden == '2'){
            if($("#param").val() == "" || $("#param").val() == undefined || $("#param").val().length <= 0){
              return this.error('error','Ingresar Nro. Documento')
            }
            //validaciones
            this.clienteService.obtenerDatosXRuc($("#param").val())
            .subscribe(res => {
              const data = res as ClientesConsultado
              if(data.contribuyente_estado === undefined) return alert('El R.U.C no existe. Por favor vuelva a verificar')
              this.clientesSeleccion.name = data.razon_social
              this.clientesSeleccion.direction = data.domicilio_fiscal
              this.clientesSeleccion.fl_name = ''
              this.estadoEmpresa = 'Estado '+data.contribuyente_estado
              this.valorConsulta = 'dos'
              this.firstFormGroup.get('name').setValue(this.clientesSeleccion.name)
              this.firstFormGroup.get('fl_name').setValue('')
              this.firstFormGroup.get('direction').setValue(this.clientesSeleccion.direction)
            },err=>{
              console.log(err)
              this.error('error','Error al consultar R.U.C')
            });
          }else{
            this.valorConsulta = 'tres'
            this.firstFormGroup.get('name').setValue('')
            this.firstFormGroup.get('fl_name').setValue('')
            this.firstFormGroup.get('direction').setValue('')
          }
        }
      },err=>{
        this.error('error',err.error)
      });

  }
